import logo from '../src/img/logo.png';
import './App.css';

function App() {
  return (
    <div className="food">

      <div className="navbar">
          <img src={logo} alt="" />

          <div className="ul">
              <li className="li">
                <a href="#" className="a">Home</a>
              </li>

              <li className="li">
                <a href="#" className="a">Product</a>
              </li>

              <li className="li">
                <a href="#" className="a">Faq</a>
              </li>

              <li className="li">
                <a href="#" className="a">Contact</a>
              </li>
          </div>
      </div>



    </div>
  );
}

export default App;
